import React, { useState } from 'react';

const Domainchecker = () => {

    return ( 

        <form>
            <input type="text" name="domainname" placeholder="Enter Your Domain Name" className="text-secondary" required/>
            <input type="button" value="Search" id="submit"/>
        </form>
     );
}
 
export default Domainchecker;
